import React from 'react';

const QuestionDisplay = ({ generatedQuestions }) => {
  return (
    <ul>
      {generatedQuestions.map((question, index) => (
        <li key={index}>{question}</li>
      ))}
    </ul>
  );
};

export default QuestionDisplay;
